import { useNavigate } from "react-router-dom";

function VerifiedHeader() {
  const navigate = useNavigate();

  function handleLogo() {
    navigate('/');
  }

  function handleAccount() {
    navigate('/account');
  }

  function handleProfile() {
    navigate('/dashboard');
  }

  return (
    <header className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="container-fluid">
        <a className="navbar-brand logo" href="#" onClick={handleLogo}><span className="green-text">Spotify</span>Stats</a>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
              <a className="nav-link" href="#" onClick={handleAccount}>Account</a>
            </li>
          </ul>
          <div className="positioning-div focus">
            <button className="auth-button" onClick={handleProfile}>
              <h2>Profile</h2>
            </button>
          </div>
        </div>
      </div>
    </header>
  );
}

export default VerifiedHeader;
